column13:
A door for an aircraft (10), comprising: 
a door body (20) having an exterior side (11) and an interior side (13) opposite the exterior side (11); 
an exterior handle (30) movably connected to the door body (20), the exterior handle (30) rotatable between a stowed position, in which the exterior handle (30) is recessed within an opening of the door body (20), and an unstowed position, the exterior handle (30) being accessible from the exterior side (11) of the door body (20) to open the door; 
a hook (42) connected to the door body (20) and selectively moveable between a retained position and an unretained position, the retained position to secure the exterior handle (30) in the stowed position; and 
a visual indicator (40) mechanically coupled to the hook (42), 
wherein the visual indicator (40) is visible from the interior side (13) of the door body (20) only when the hook (42) is in the retained position.
